INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (5, "カリン", 2.12, 1, 64, 0.0, 190801, 2, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, -363.0, "2025/01/31 12:00:00", 1000005, "2030/01/01 14:59:59");
