INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (101, "ラビリスタ", 5.18, 7, 61, -6.0, 133701, 3, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 10201, -285.0, "2025/01/31 12:00:00", 1020101, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (201, "クリスティーナ", 8.77, 2, 61, -2.0, 133901, 1, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 10201, -285.0, "2025/01/31 12:00:00", 1020102, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (301, "ネネカ", 15.5, 1, 61, 0.0, 133801, 6, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 10201, -285.0, "2025/01/31 12:00:00", 1020103, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (101, "ランファ", 9.061, 5, 61, 0.0, 134301, 2, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 10202, -285.0, "2025/02/28 12:00:00", 1020201, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (201, "チカ", 7.699, 2, 61, 0.0, 134401, 1, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 10202, -285.0, "2025/02/28 12:00:00", 1020202, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (101, "アオイ", 8.595, 2, 61, 0.0, 134601, 1, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 10203, -285.0, "2025/03/31 12:00:00", 1020301, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (201, "クローチェ", 7.758, 2, 61, 0.0, 134501, 1, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 10203, -285.0, "2025/03/31 12:00:00", 1020302, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (101, "ルイズマリー", 7.0, 6, 61, 0.0, 132302, 2, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 10204, -285.0, "2025/04/30 12:00:00", 1020401, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (201, "イロハ", 7.904, 2, 61, 0.0, 132402, 1, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 10204, -285.0, "2025/04/30 12:00:00", 1020402, "2030/01/01 14:59:59");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (301, "ソノ", 8.487, 2, 61, 0.0, 132502, 4, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 10204, -285.0, "2025/04/30 12:00:00", 1020403, "2030/01/01 14:59:59");
